import React from "react";

const HotelType = (props) => {
  return (
    <div className="container">
      <div className="row">
        {props.type.map((type, index) => {
          return (
            <div className="col-12 col-lg" key={index}>
              <img src={type.image} width="100%" alt={type.name} />
              <div></div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default HotelType;
